css:
@keyframes atomTypescriptTooltipFadeIn {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
.atom-typescript-tooltip {
  font-family: Consolas, monospace;
  white-space: pre !important;
  border-radius: 5px;
  animation-name: atomTypescriptTooltipFadeIn;
  animation-duration: 300ms;
  animation-fill-mode: both;
  pointer-events: none;
}
.atom-typescript-tooltip .tooltip-inner {
  text-align: left;
}
.atom-typescript-tooltip .tooltip-inner .atom-typescript-tooltip-tooltip-code {
  font-weight: bold;
  white-space: pre-wrap;
  word-wrap: break-word;
}
.atom-typescript-tooltip .tooltip-inner .atom-typescript-datatip-tooltip-doc {
  white-space: pre-line;
}
